import React, { useState } from "react";

import { useNavigate } from "react-router-dom";

const initialUser = {Firstname: "", Lastname: "", Email: "", phone_No: "", Password: ""} 
const Register = ({name}) =>{

    const [user, setUser] = useState(initialUser);

    const navigate = useNavigate()

    if(name !== "user"){
        throw new Error("something went wrong!!")
    }
    const Register = () =>{
        setUser(user)
        navigate ('/login')
    }
    return(
        <div>
            <h2>Register {name}</h2>
            <form>
                <div>
                    <label>Firstname:</label>
                    <input type="text" value={user.Firstname} onChange={e => setUser({...user, Firstname: e.target.value})}/>
                </div>
                <div>
                    <label>Lastname:</label>
                    <input type="text" value={user.Lastname} onChange={e => setUser({...user, Lastname: e.target.value})}/>
                </div>
                <div>
                    <label>Email:</label>
                    <input type="text" value={user.Email} onChange={e => setUser({...user, Email: e.target.value})}/>
                </div>
                <div>
                    <label>phone_No:</label>
                    <input type="text" value={user.phone_No} onChange={e => setUser({...user, phone_No: e.target.value})}/>
                </div>
                <div>
                    <label>Password:</label>
                    <input type="text" value={user.Password} onChange={e => setUser({...user, Password: e.target.value})}/>
                </div>
            <button onClick={Register}>register</button>
            </form>

        </div>
    )
}

export default Register
